import React, {Component} from 'react';
import AboutMe from './components/AboutMe.js';
import WorkExperience from './components/WorkExperience.js';
import Projects from './components/Projects.js';
import Skills from './components/Skills.js';
import Profile from './components/Profile.js';
import scrollToComponent from 'react-scroll-to-component';
import "tachyons";
import './App.css';

class App extends Component{

  render(){
    return (
      <div className="App flex noscroll">

        <div className='bg w-25 .relative bg-navy scroll' >
          <Profile/>
          <div className='pt5 tc componentRouting'>
            <div>
              <button className="f4 link dim bw2 ph3 pv2 mb2 dib white">About me</button><br/>
            </div>
            <div>
              <a className="f4 link dim bw2 ph3 pv2 mb2 dib white" href="#0">Experience</a><br/>
            </div>
            <div>
              <a className="f4 link dim bw2 ph3 pv2 mb2 dib white" href="#0">Projects</a><br/>
            </div>
            <div>
              <a className="f4 link dim bw2 ph3 pv2 mb2 dib white" href="#0">Skills</a><br/>
            </div>
          </div>
        </div>

      	<div className="w-75 bg-near-white pa3 ph5-ns scroll">
          <AboutMe/>
          <WorkExperience/>
          <Projects/>
          <Skills/>
      	</div>

      </div>
    );
  }
}

export default App;
